var title_f42_39_43632="Specific E2 antigen in PBC";
var content_f42_39_43632=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F63356&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F63356&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    E2 antigen in primary biliary cirrhosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 351px; height: 271px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Confocal micrographs of bile ducts from a patient with PBC (panels A and C) and primary sclerosing cholangitis (PSC, panels B and D). The sections are stained with a mouse monoclonal antibody directed against the E2 antigen of human pyruvate dehydrogenase. Panel A: The PBC bile duct epithelial cells demonstrate intense homogeneous luminal staining (arrow). Only one of eight mouse monoclonal antibodies reacted with the luminal antigen in the PBC bile duct cell. This suggests that the reaction was with protein that had some antigenic similarity to pyruvate dehydrogenase but was different from it. Panel B: The PSC bile duct shows only granular staining similar to that of normal mitochondrial staining in the cytoplasm. Panel C: The PBC bile duct section was examined using Lutz color intensity banding. Red staining, which is the second highest intensity to white, is found at the luminal surface and is different from the blue and green staining of mitochondria. Panel D: In the PSC bile duct, staining is restricted to low intensity green and blue and and demonstrates only the normal staining of mitochondria.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with permission from: Van de Water J, Turchany J, Leung PS, et al. J Clin Invest 1993; 91:2656.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
