"      <i>",
"       Clinical Practice Guidelines",
"      </i>",
"      , National Institutes of Health, National Heart, Lung, and Blood Institute, NIH Publication No. 08-4051, prepublication 2007. Available at",
"      <a href=\"file://www.nhlbi.nih.gov/guidelines/asthma/asthgdln.htm\" target=\"_blank\">",
"       file://www.nhlbi.nih.gov/guidelines/asthma/asthgdln.htm",
