"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?42/39/43639/contributors\">",
"     Scott Manaker, MD, PhD",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?42/39/43639/contributors\">",
"     Timothy O Lipman, MD",
"    </a>",
"    <br/>",
"   </div>",
