var title_f42_39_43644="EEG findings in specific epilepsy syndromes";
var content_f42_39_43644=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F50497&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F50497&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Electroencephalographic features of some epilepsy syndromes",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Epilepsy syndromes",
"      </td>",
"      <td class=\"subtitle1\">",
"       EEG findings",
"      </td>",
"      <td class=\"subtitle1\">",
"       Additional EEG features",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"3\">",
"       Generalized",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Absence epilepsy",
"      </td>",
"      <td>",
"       3-Hz generalized spike-and-slow wave; often repetitive trains of discharges",
"      </td>",
"      <td>",
"       Normal background; activation of IEDs and seizures with hyperventilation",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Atypical absence epilepsy",
"      </td>",
"      <td>",
"       1.5 to 2.5-Hz generalized spike-and-slow wave discharges",
"      </td>",
"      <td>",
"       IEDs may be asymmetric, with shifting focal features",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Juvenile myoclonic epilepsy",
"      </td>",
"      <td>",
"       4 to 6-Hz generalized spike and multiple spike-and-slow wave",
"      </td>",
"      <td>",
"       Normal background; activation of IEDs with photic stimulation is common; more typical 2.5 to 3-Hz spike-and-slow wave may be seen; IEDs may be asymmetric, with shifting focal features",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Infantile spasms",
"      </td>",
"      <td>",
"       Hypsarrhythmia and multifocal spikes and sharp waves",
"      </td>",
"      <td>",
"       No clearly normal background activity since the EEG is dominated by the hypsarrhythmia pattern",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Lennox-Gastaut syndrome",
"      </td>",
"      <td>",
"       &lt;2.5-Hz generalized sharp-and-slow wave discharges",
"      </td>",
"      <td>",
"       Generalized background slowing and paroxysmal fast activity; often multifocal spikes and sharp waves",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Progressive myoclonic epilepsy",
"      </td>",
"      <td>",
"       Generalized and multifocal spikes, multiple spikes, and sharp waves",
"      </td>",
"      <td>",
"       Progressive background slowing with disease progression; photic activation of IEDs in some cases",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"3\">",
"       Partial",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Benign rolandic epilepsy",
"      </td>",
"      <td>",
"       Large-amplitude spikes or sharp waves, maximal over the centrotemporal region",
"      </td>",
"      <td>",
"       Normal background; often prominent activation of IEDs with sleep; the discharge can be bilateral or unilateral and often has an anterior-posterior field of a tangential dipole",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Benign occipital epilepsy",
"      </td>",
"      <td>",
"       Bilateral or unilateral occipital spike-and-slow wave discharges",
"      </td>",
"      <td>",
"       Occipital IEDs often attenuate with eye opening; photic stimulation may precipitate seizures",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Temporal lobe epilepsy",
"      </td>",
"      <td>",
"       Temporal lobe spikes, sharp waves, and temporal intermittent rhythmic delta activity; often activated with drowsiness and sleep",
"      </td>",
"      <td>",
"       Often intermittent or persistent temporal slowing; may see independent IEDs from contralateral temporal lobe",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Frontal lobe epilepsy",
"      </td>",
"      <td>",
"       IEDs in the frontal region",
"      </td>",
"      <td>",
"       Mesial frontal discharges often are not detected by scalp EEG; secondary bilateral synchrony can occur",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     EEG: electroencephalographic; IED: interictal epileptiform discharge.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Worrell GA, Lagerlund TD, Buchhalter JR. Role and limitations of routine and ambulatory scalp electroencephalography in diagnosing and managing seizures. Mayo Clin Proc 2002; 77:991. Copyright &copy; 2002 Dowden Health Media.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
